import React from 'react';
import styled from 'styled-components';

import '../App.css';
const Divcon = styled.div
    `
display: flex;
justify-content: center;
flex-direction: row;
flex-wrap: wrap;

`
const A = styled.a
    `
text-decoration: none;
`
const MyForm = styled.form`background-color: #F2F3F4;text-align: left;padding: 20px;`;


class UMAN extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            UID: "",
            fname: "",
            lname: "",
            Email: "",
            address: "",
            pnumber: "",
            DOB: "",
            username: "",
            pword: "",
            urole: "user",
        }
        this.handleChange = this.handleChange.bind(this);
    }
    insert() {
        /* Call WS to insert a new student */
        
        let rooturl = "http://localhost:3030/user"
        fetch(rooturl,
            {
                method: "POST",
                body: JSON.stringify({

                }),
                headers: {
                    "content-type": "application/json",
                    "accept": "application/json"
                },
            })
            .then((response) => response.json())
            .then((data) => {
                console.log(data);
            });
        //output += "</div>"

    }
    update() {
        /* Call WS to update the student */

    }
    delete() {/* Call WS to delete the student */

    }
    search()
    {
        //alert(this.state.UID)
        let rooturl = "http://localhost:3030/user/";
        fetch(rooturl,
            {
                method: "GET",
                headers: {
                    "content-type": "application/json",
                    "accept": "application/json"
                },
            })
            .then((response) => response.json())
            .then((data) => {
                console.log(data.Data);
                let output = "";
                output += `<div  class="eiei"><h1 style="color:black"> user List </h1>`;
                output += "<table class='table'>";
                output += "<thead>";
                output += "<tr>";
                output +=
                    "<th scope='col'>#</th><th scope='col'>First name</th><th scope='col'> Last name </th> <th scope='col'> Email </th> <th scope='col'> Address </th> <th scope='col'> Phone number </th>  <th scope='col'>DOB</th> <th scope='col'>Username</th> <th scope='col'> Password </th> <th scope='col'> Role </th>";
                output += "</tr>";
                output += "</thread>";
                output += "<tbody>";
                data.data.forEach((element) => {
                    output += "<tr>";
                    output += "<td>" + element.UID + "</td>";
                    output += "<td>" + element.fname + "</td>";
                    output += "<td>" + element.lname + "</td>";
                    output += "<td>" + element.Esmail + "</td>";
                    output += "<td>" + element.address + "</td>";
                    output += "<td>" + element.pnumber + "</td>";
                    output += "<td>" + element.DOB + "</td>";
                    output += "<td>" + element.username + "</td>";
                    output += "<td>" + element.pnumber + "</td>";
                    output += "<td>" + element.urole + "</td>";
                });
                output += "</tbody>";
                output += "</table></div>";
                let result = document.querySelector("#output");
                result.innerHTML += output;

            })
            .catch((err) => {
                console.log(err);
            });
    }
    selectAll() {
        /* Call WS to get all students */
        let rooturl = "http://localhost:3030/users";
        fetch(rooturl,
            {
                method: "GET",
                headers: {
                    "content-type": "application/json",
                    "accept": "application/json"
                },
            })
            .then((response) => response.json())
            .then((data) => {
                console.log(data.Data);
                let output = "";
                output += `<div  class="eiei"><h1 style="color:black"> user List </h1>`;
                output += "<table class='table'>";
                output += "<thead>";
                output += "<tr>";
                output +=
                    "<th scope='col'>#</th><th scope='col'>First name</th><th scope='col'> Last name </th> <th scope='col'> Email </th> <th scope='col'> Address </th> <th scope='col'> Phone number </th>  <th scope='col'>DOB</th> <th scope='col'>Username</th> <th scope='col'> Password </th> <th scope='col'> Role </th>";
                output += "</tr>";
                output += "</thread>";
                output += "<tbody>";
                data.data.forEach((element) => {
                    output += "<tr>";
                    output += "<td>" + element.UID + "</td>";
                    output += "<td>" + element.fname + "</td>";
                    output += "<td>" + element.lname + "</td>";
                    output += "<td>" + element.Esmail + "</td>";
                    output += "<td>" + element.address + "</td>";
                    output += "<td>" + element.pnumber + "</td>";
                    output += "<td>" + element.DOB + "</td>";
                    output += "<td>" + element.username + "</td>";
                    output += "<td>" + element.pnumber + "</td>";
                    output += "<td>" + element.urole + "</td>";
                });
                output += "</tbody>";
                output += "</table></div>";
                let result = document.querySelector("#output");
                result.innerHTML += output;

            })
            .catch((err) => {
                console.log(err);
            });
    }
    handleChange(e) {
        const target=e.target;
        const value=target.value;
        const elementname=target.name;
        this.setState({[elementname]:value,})
    }

    render() {
        return (<>
            <a href="http://localhost:3000/admin"><button class="back">Back to home page</button></a>
            <h1 style={{ color: "black" }} id="top">User management</h1>
            <div>
                <MyForm onSubmit={this.handleSubmit}>
                    <label>UserID: </label>
                    <input name="UID" type="text" value={this.state.UID} onChange={this.handleChange} /><br />
                    <label>Fristname: </label>
                    <input name="fname" type="text" value={this.state.fname} onChange={this.handleChange} /><br />
                    <label>Lastname: </label>
                    <input name="lname" type="text" value={this.state.lname} onChange={this.handleChange} /><br />
                    <label>Email: </label>
                    <input name="Email" type="text" value={this.state.Email} onChange={this.handleChange} /><br />
                    <label>Address: </label>
                    <input name="address" type="text" value={this.state.address} onChange={this.handleChange} /><br />
                    <label>Phone number: </label>
                    <input name="pnumber" type="text" value={this.state.pnumber} onChange={this.handleChange} /><br />
                    <label>Date of birth: </label>
                    <input name="DOB" type="date" value={this.state.DOB} onChange={this.handleChange} /><br />
                    <label>Username: </label>
                    <input name="username" type="text" value={this.state.username} onChange={this.handleChange} /><br />
                    <label>Password: </label>
                    <input name="pword" type="text" value={this.state.pword} onChange={this.handleChange} /><br />
                    <label>Role: </label>
                    <select name="urole" type="text" value={this.state.urole} onChange={this.handleChange}><br />
                        <option value="user">user</option>
                        <option value="admin">admin</option>
                    </select><br />
                    <button type="button" onClick={this.insert}>Insert</button>
                    <button type="button" onClick={this.update}>Update</button>
                    <button type="button" onClick={this.delete}>Delete</button>
                    <button type="button" onClick={this.search}>Search</button>
                    <button type="button" onClick={this.selectAll}>search all</button>
                </MyForm>
            
                <div id="output">
                </div>
                <footer>
